import React, { Component } from 'react';
import Post from './components/post';
import './App.css';

class App extends Component {
  componentWillMount(){
    fetch('https://jsonplaceholder.typicode.com/posts')
    .then(res => res.json())
    .then(data => console.log(data));
  }
  render() {
    return (
     <div>
       <Post />
     </div>
    );
  }
}

export default App;
